import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Route } from "react-router-dom";
import ExerciseList from "./component/ExerciseList";
import EditExercise from "./component/EditExercise";
import CreateExercise from "./component/CreateExercise";
import CreateUser from "./component/CreateUser";
import NavbarArea from "./component/NavbarArea";
import Footer from "./component/Footer";

function App() {
  return (
    <div>
      <Router>
      <NavbarArea />
      <div className="container">
        <br />
        <Route path="/"  exact component={ExerciseList} />
        <Route path="/EditExercise/:id" component={EditExercise} />
        <Route path="/CreateExercise" component={CreateExercise} />
        <Route path="/CreateUser" component={CreateUser} />
        </div>
      </Router>
    <Footer />
    </div>

  );
}

export default App;
